import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './routes/login'

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Login} />
      </Switch>
    </Router>
  );
}

export default App;
